import styled, { css } from "styled-components";
import { Link } from "react-router-dom";
export const ContactContainer = styled.div`
  display: flex;
`;
export const LinkContainer = styled(Link)`
  width: 60px;
  height: 60px;
  margin: 5px;
  background: red;
  border-radius: 50%;
  cursor: pointer;
`;
export const IconContainer = styled.div``;
